import React from "react";
import LecturesListItem from "./LecturesListItem";
import { connect } from "react-redux";
import "../../../shared/UI/css/subject.css";

const LecturesList = ({ subjects }) => {
  return (
    <div className="subjectList-container">
      {subjects.map((subject) => (
        <LecturesListItem
          key={subject.id}
          name={subject.name}
          code={subject.code}
        />
      ))}
    </div>
  );
};

const mapStoreStateToProps = ({ subjects }) => {
  return {
    ...subjects,
  };
};

export default connect(mapStoreStateToProps)(SubjectsList);
